import "./index.css";
import image from "./logo.svg";

function Header() {
  return (
    <div className="header">
      <div>
        <ul>
          <li>
            <img src={image} width="154px" height="20px" />
            <a href="#">Movies</a>
            <a href="#">Tv Show</a>
            <a href="#">People</a>
            <a href="#">Movies</a>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Header;
